import React, { Component } from 'react';
import ReactDom from 'react-dom';
import axios from 'axios';
//引入组件
import { Layout } from 'antd';
import Sider_first from './components/Sider/目标转化事件/index';
import Sider_second from './components/Sider/待归因事件/index';
import Sider_third from './components/Sider/过程事件/index'
//引入图标
import { SendOutlined } from '@ant-design/icons';
//引入css文件
import 'antd/dist/antd.css';
import './style.css';

const { Header, Footer, Content, Sider } = Layout;

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            events: [],
            attrs: [],
            values: []
        }

    }

    componentDidMount() {
        //接口请求数据
        //events
        axios.get('/events')
            .then((res) => {
                this.setState({
                    events: res.data
                })
                // console.log(this.state.events)
            })
            .catch((err) => {
                console.log(err)
            })
        //attrs
        axios.get('/attrs')
            .then((res) => {
                this.setState({
                    attrs: res.data
                })
                // console.log(this.state.attrs)
            })
            .catch((err) => {
                console.log(err)
            })
        //values
        axios.get('/values')
            .then((res) => {
                this.setState({
                    values: res.data
                })
                // console.log(this.state.values)
            })
            .catch((err) => {
                console.log(err)
            })
    }
    render() {
        return (
            <Layout className='layout'>
                <Header className='header'>
                    归因分析
                </Header>
                <Layout className='layout'>
                    <Sider className='sider'>
                        <h1 className='primarytitle'><SendOutlined className='icon icon_top' />选择事件</h1>
                        <form>
                            <div className='siderfirst'>
                                <span className='secondarytitle span'>目标转化事件：</span>
                                <Sider_first events={this.state.events} attrs={this.state.attrs} />
                            </div>
                            <div className='sidersecond'>
                                <p className='secondarytitle'>待归因事件：</p>
                                <Sider_second  events={this.state.events} attrs={this.state.attrs} />
                            </div>
                            <div className='siderthird'>
                                <p className='secondarytitle'>过程事件：</p>
                                <Sider_third  events={this.state.events} attrs={this.state.attrs} />
                            </div>
                            <div className='siderfourth'>
                                <p className='secondarytitle'>查看方式：</p>
                                <Sider_third  events={this.state.events} attrs={this.state.attrs} />
                            </div>
                        </form>
                    </Sider>
                    <Content className='content'>
                        haha
                    </Content>
                </Layout>
                {/* <Footer className='footer'>
                    Footer
                </Footer> */}
            </Layout>
        )
    }
}

ReactDom.render(<App />, document.getElementById('root'))
